# Compact format in line
# DS=;RS=;SZ=;WT=;RE=;RM=;CP=;OS=;SM=;
# what does each shortcode mean?
# DS - Display size
# RS - Resolution screen (W x H)
# SZ - Device Size (W x H x T)
# RE - Release date
# OS - OS name + version
# RM - RAM in MB
# CP - CPU id
# GP - GPU id
# SM - count SIM slots

